import "../css/Profile.css";

function Profile() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>THIS IS THE PROFILE PAGE</p>
        <a
          className="App-link"
          href="/"
          target="_blank"
          rel="noopener noreferrer"
        >
          Profile
        </a>
      </header>
    </div>
  );
}

export default Profile;
